import { AppBar } from "@material-ui/core";
import { Toolbar } from "@mui/material";

const Footer = () => {
  return (
    <>
      <Toolbar
        position="static"
        sx={{ width: "90%", m: "0 auto", borderBottom: "1px solid" }}
      >
        Hi
      </Toolbar>
      <Toolbar></Toolbar>
    </>
  );
};

export default Footer;
